/* Others styles */
/* l nav */
@import url("https://fonts.googleapis.com/css2?family=Mulish&display=swap");
@import url("https://fonts.googleapis.com/css2?family=Work+Sans:ital,wght@0,100;0,200;0,300;0,400;0,500;0,600;0,700;0,800;0,900;1,100;1,200;1,300;1,400;1,500;1,600;1,700;1,800;1,900&display=swap");
.l-navbar {
  position: fixed;
  top: 0;
  left: 0;
  width: var(--nav-width);
  height: 100vh;
  background-color: var(--white-color);
  color: var(--white-color);
  padding: 10px 20px;
  transition: 0.5s;
  z-index: var(--z-fixed);
}

/* nav */
.nav {
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: space-between;
  overflow: hidden;
}
.nav__brand {
  display: grid;
  grid-template-columns: max-content max-content;
  justify-content: space-between;
  align-items: center;
  margin-bottom: 2rem;
}
.nav__brand img {
  padding: 10px 18px;
}
.nav__toggle {
  font-size: var(--nav-icon-text);
  color: var(--second-color);
  padding: 10px;
  cursor: pointer;
}
.nav__logo {
  color: var(--second-color);
  font-weight: 600;
}
.nav__link {
  display: grid;
  grid-template-columns: max-content max-content;
  align-items: center;
  column-gap: 0.75rem;
  color: var(--white-color);
  margin-bottom: 25px;
  transition: 0.3s;
  cursor: pointer;
}
.nav__link:hover > :first-child {
  color: var(--first-color);
}
.nav__link:hover > :first-child:not(ion-icon) {
  background-color: var(--first-color);
  color: var(--white-color);
}
.nav__link > :first-child {
  padding: 10px 8px;
  border-radius: 5px;
}
.nav__link > :first-child:not(ion-icon) {
  width: 50px;
  background-color: var(--second-color);
}
.nav__link--selected > :first-child {
  color: var(--first-color);
}
.nav__link--selected > :first-child:not(ion-icon) {
  background-color: var(--first-color);
  color: var(--white-color);
}
.nav__icon {
  font-size: var(--nav-icon-text);
  width: 30px;
  text-align: center;
}
.nav__icon span {
  color: var(--black-color);
}
.nav__icon:not(span) {
  color: var(--second-color);
}
.nav__name {
  font-size: var(--small-font-size);
  width: 100%;
  padding: 15px 8px;
  border-radius: 5px;
  background-color: #F7F8FA;
  color: var(--black-color);
}
.nav #signOutBtn {
  background-color: var(--white-color);
  color: var(--second-color);
}

/* expander */
.expand {
  width: calc(var(--nav-width) + 160px);
  box-shadow: var(--shadow1);
}

.login {
  height: 100vh;
  margin-left: 1.5rem;
  margin-right: 1.5rem;
}
.login__content {
  display: flex;
  height: 100vh;
  align-items: center;
  padding: 2rem;
}
.login__img {
  justify-self: center;
  width: 60%;
}
.login__img img {
  margin: 30px auto;
  margin-bottom: 0;
  width: 80%;
}
.login__img h2 {
  font-size: 25px;
  text-align: center;
}
.login__img p {
  margin: 15px auto;
  width: 60%;
  text-align: center;
}
.login__tittle {
  font-size: var(--h1-font-size);
  margin-bottom: 1rem;
  text-align: center;
  color: var(--second-color);
}
.login__form {
  bottom: 1rem;
  display: block;
  width: 40%;
  padding: 2rem 4rem;
}
.login__form .logo {
  margin-bottom: 40px;
  display: flex;
}
.login__form .logo img {
  display: inline;
}
.login__form .logo h2 {
  display: inline;
  margin-left: 10px;
}
.login__registre {
  display: flex;
  flex-direction: column;
  background-color: var(--white-color);
  padding: 1.5rem;
  border-radius: 1rem;
  box-shadow: 0 8px 20px rgba(35, 0, 77, 0.2);
}
.login__inputBox {
  display: flex;
  position: relative;
  padding: 0.6rem 0.8rem;
  background-color: var(--bg-color);
  margin-top: 0.3rem;
  margin-bottom: 1.8rem;
  border-radius: 0.5rem;
}
.login__icon {
  font-size: 1.5rem;
  color: #A7A7A7;
}
.login__input {
  border: none;
  outline: none;
  width: 100%;
  margin-left: 5px;
  background-color: var(--bg-color);
  font-size: var(--medium-font-size);
  color: var(--black-color);
}
.login__input::placeholder {
  font-size: var(--medium-font-size);
  font-family: var(--body-font);
  color: #A7A7A7;
}
.login__inputLabel {
  font-size: var(--medium-font-size);
  color: var(--black-color);
}
.login__inputErrorMessage {
  position: absolute;
  visibility: hidden;
  bottom: -20px;
  left: -2px;
  font-size: var(--xsmall-font-size);
}
.login__inputSuccess {
  border: 1px solid #2ecc71;
}
.login__inputError {
  border: 1px solid #e74c3c;
}
.login__inputError small {
  color: #e74c3c;
  visibility: visible;
}
.login__forgot {
  position: relative;
  display: flex;
  width: 100%;
  padding: 0;
  margin-bottom: 1.5rem;
  justify-content: end;
}
.login__forgot a {
  width: max-content;
  margin-left: auto;
  font-size: var(--small-font-size);
  font-weight: 600;
  color: var(--second-color);
}
.login__button {
  display: block;
  padding: 0.5rem;
  margin-bottom: 1.2rem;
  background-color: var(--first-color);
  color: #fff;
  font-weight: 600;
  text-align: center;
  border-radius: 0.5rem;
  transition: 0.3s;
}
.login__button:hover {
  background-color: var(--first-color-dark);
}
.login__account {
  display: flex;
  justify-content: center;
}
.login__accountAlready {
  font-weight: 600;
  font-size: var(--small-font-size);
  color: var(--black-color);
  text-align: center;
}
.login__accountChange {
  margin-left: 5px;
  font-weight: 600;
  font-size: var(--small-font-size);
  color: var(--first-color);
  cursor: pointer;
}

@media screen and (max-width: 700px) {
  .login__img {
    width: 100%;
  }
  .login__form {
    width: 100%;
    justify-self: center;
    padding: 1.5rem;
  }
  .login__content {
    flex-direction: column;
    justify-content: center;
    align-items: center;
  }
}
@media screen and (min-width: 701px) and (max-width: 1024px) {
  .login {
    margin-left: 1rem;
    margin-right: 1rem;
  }
  .login__content {
    padding: 1rem;
  }
  .login__img {
    width: 50%;
  }
  .login__form {
    width: 50%;
    padding: 1rem 2rem;
  }
}
.container {
  position: relative;
  width: 100%;
  height: 100vh;
  display: flex;
  justify-content: space-between;
}

.dashboard__container {
  position: absolute;
  margin-left: var(--nav-width);
  width: 68%;
  height: 100vh;
}
.dashboard__header {
  display: flex;
  justify-content: space-between;
  background-color: var(--white-color);
  margin: 0px 20px;
  padding: 30px 30px 20px;
  border-end-end-radius: 5px;
  border-end-start-radius: 5px;
}
.dashboard__header h2 {
  margin: auto 0;
}
.dashboard__main {
  display: flex;
}
.dashboard__maininfo {
  width: 100%;
  padding: 20px;
}
.dashboard__maintittle {
  position: relative;
  width: 100%;
  background-color: var(--white-color);
  border-radius: 0.5rem;
  display: flex;
  height: 120px;
}
.dashboard__maintittle img {
  position: absolute;
  height: 120%;
  right: 20px;
  bottom: 0;
}
.dashboard__maingreeting {
  padding-left: 2rem;
  margin: auto 0;
  width: 70%;
}
.dashboard__maingreeting h3 {
  margin: 0;
}
.dashboard__maingreeting p {
  margin: 0;
}
.dashboard__coursesContainer {
  display: flex;
  flex-wrap: wrap;
}
.dashboard__course {
  width: 31%;
  margin-top: 20px;
  margin-left: 15px;
  background-color: var(--white-color);
  border-radius: 5px;
  padding: 20px;
  cursor: pointer;
}
.dashboard__course:hover {
  box-shadow: 2px 0px 10px rgba(138, 138, 138, 0.25);
  transition: 0.3s;
  transform: translate(-2px, -2px);
}
.dashboard__course p {
  margin-top: 10px;
  font-weight: 500;
  color: var(--black-color);
}
.dashboard__course p:first-child {
  font-size: 30px;
  font-weight: 600;
  margin: 0;
  color: var(--second-color);
}
.dashboard__course p:last-child {
  margin-top: 5px;
  font-weight: 300;
}
.dashboard__notification {
  font-weight: 600;
  font-size: var(--small-font-size);
  color: var(--first-color);
  visibility: hidden;
}
.dashboard__notification:hover {
  color: var(--first-color-dark);
}
.dashboard__notification:hover ion-icon {
  transition: 0.3s;
  transform: translate(8px);
}
.dashboard__notification--visible {
  visibility: visible;
}
.dashboard__info {
  position: fixed;
  width: 25%;
  height: 100vh;
  right: 0;
  padding: 20px 30px;
  background-color: var(--white-color);
  overflow-y: scroll;
  overflow-x: hidden;
}
.dashboard__infoCard {
  margin-top: 20px;
  padding: 20px;
  background-color: #F1F2F6;
  border-radius: 5px;
}
.dashboard__infoCard h4 {
  margin: 0;
}

.alert {
  border-radius: 10px;
  box-shadow: var(--shadow1);
  display: flex;
  padding: 0.8rem;
  margin-top: 15px;
  justify-content: space-between;
}
.alert__content {
  margin: auto 0;
  display: flex;
  align-items: center;
}
.alert__contentmessage {
  display: flex;
  flex-direction: column;
  margin-left: 1rem;
}
.alert ion-icon {
  color: var(--second-color);
  font-size: var(--normal-font-size);
}
.alert__subject {
  font-size: var(--normal-font-size);
  font-weight: 700;
}
.alert__message {
  font-size: var(--medium-font-size);
}
.alert__button {
  margin: auto 0;
  display: flex;
  align-items: center;
}

@media screen and (max-width: 700px) {
  .alert {
    background-color: wheat;
  }
}
@media screen and (min-width: 701px) and (max-width: 1024px) {
  .alert {
    background-color: blue;
  }
}
.statisticschart {
  display: inline-block;
  margin: 0;
  box-shadow: var(--shadow1);
  width: 48%;
  border-radius: 10px;
  margin-top: 15px;
  padding: 20px;
}
.statisticschart__tittle {
  font-size: var(--normal-font-size);
  text-align: center;
  color: var(--first-color);
  margin: 0;
}
.statisticschart__tittle h3 {
  font-size: var(--normal-font-size);
  margin: 0;
}
.statisticschart__statistics {
  display: flex;
}
.statisticschart__statistics h4 {
  font-size: var(--medium-font-size);
}
.statisticschart__statisticsleft {
  width: 40%;
}
.statisticschart__statisticsright {
  width: 60%;
}

.form__inputBox {
  margin: 0;
  margin-top: 0.3rem;
  margin-bottom: 30px;
}
.form__icon {
  font-size: 1.5rem;
  color: var(--first-color-light);
}
.form__input {
  padding: 0.6rem 0.8rem;
  background-color: var(--bg-color);
  border-radius: 0.5rem;
  border: none;
  outline: none;
  margin-left: 5px;
  font-size: var(--medium-font-size);
  color: var(--black-color);
  font-family: var(--body-font);
}
.form__input::placeholder {
  font-family: var(--body-font);
  font-size: var(--medium-font-size);
  color: #D6A3FF;
}
.form__inputLabel {
  font-size: var(--medium-font-size);
  color: var(--black-color);
  font-weight: 500px;
}
.form__inputErrorMessage {
  position: absolute;
  visibility: hidden;
  bottom: -20px;
  left: -2px;
  font-size: var(--xsmall-font-size);
}
.form__inputSuccess {
  border: 1px solid #2ecc71;
}
.form__inputError {
  border: 1px solid #e74c3c;
}
.form__inputError small {
  color: #e74c3c;
  visibility: visible;
}
.form__textarea {
  resize: none;
  height: 100px;
  padding: 0.6rem 0.8rem;
  background-color: var(--bg-color);
  border-radius: 0.5rem;
  border: none;
  outline: none;
  margin-left: 5px;
  font-size: var(--medium-font-size);
  color: var(--black-color);
  font-family: var(--body-font);
}
.form__textarea::placeholder {
  font-family: var(--body-font);
  font-size: var(--medium-font-size);
  color: #D6A3FF;
}
.form__textareaLabel {
  font-size: var(--medium-font-size);
  color: var(--black-color);
  font-weight: 500px;
}

.container2 {
  position: relative;
  width: 100%;
  display: flex;
  justify-content: space-between;
}

.course__container {
  position: relative;
  margin-left: var(--nav-width);
  margin-right: var(--right-aside-width);
  width: 100%;
}
.course__header {
  height: var(--top-nav-height);
  background-color: var(--white-color);
  margin: 0px 20px;
  padding: 30px;
  padding-bottom: 20px;
  border-end-end-radius: 5px;
  border-end-start-radius: 5px;
}
.course__main {
  position: relative;
  height: calc(100vh - 140px);
  margin: 20px 20px 0px;
  border-start-start-radius: 5px;
  border-start-end-radius: 5px;
}
.course__main::-webkit-scrollbar {
  width: 8px;
}
.course__main::-webkit-scrollbar-track {
  background-color: var(--color-lighten);
  border-radius: 5px;
}
.course__main::-webkit-scrollbar-thumb {
  background-color: var(--gray-color-light);
  border-radius: 5px;
}
.course__mainInfoCourse {
  background-color: var(--white-color);
  padding: 30px;
}
.course__mainInfoCourse div {
  margin-top: 20px;
}
.course__mainInfoCourse h3 {
  margin: 0;
  display: inline-block;
}
.course__mainInfoCourse p {
  margin: 0;
  display: inline-block;
}
.course__notes {
  position: fixed;
  width: var(--right-aside-width);
  height: 100vh;
  right: 0;
  padding: 30px;
  background-color: var(--white-color);
}

.tabs {
  height: 100%;
}
.tabs__header {
  display: flex;
  align-items: center;
  justify-content: space-evenly;
  width: 100%;
}
.tabs__headerTab {
  position: relative;
  margin-top: 20px;
  margin-bottom: 10px;
  color: var(--gray-color-light);
  cursor: pointer;
  font-weight: 500;
  transition: 0.3s;
}
.tabs__headerTab:hover {
  color: var(--second-color-lilac);
}
.tabs__headerTab::after {
  position: absolute;
  left: 0;
  bottom: -5px;
  content: "";
  width: 0%;
  height: 3px;
  background-color: var(--second-color-lilac);
  border-radius: 5px;
}
.tabs__headerTab:hover::after {
  transition: 0.3s;
  width: 100%;
}
.tabs__headerTab--active {
  color: var(--second-color);
}
.tabs__headerTab--active::after {
  position: absolute;
  left: 0;
  bottom: -5px;
  content: "";
  width: 100%;
  height: 3px;
  background-color: var(--second-color);
  border-radius: 10px;
}
.tabs__body {
  overflow-y: scroll;
}
.tabs__bodyContent {
  height: 100%;
  position: absolute;
  visibility: hidden;
  opacity: 0;
  transform: scale(0.98);
  transition: opacity 0.3s ease-in-out 0ms, transform 0.3s ease-in-out 0ms;
}
.tabs__bodyContent--active {
  height: 100%;
  visibility: visible;
  opacity: 1;
  transform: scale(1);
}

.coursecard__container {
  position: relative;
  width: 100%;
  padding-right: 10px;
}
.coursecard__card {
  position: relative;
  margin-bottom: 20px;
  padding: 30px;
  background-color: var(--white-color);
  width: 100%;
  height: calc(100% + var(--bottom-card-height));
  border-radius: 5px;
  box-shadow: 0px 0px 6px 0px #0000001A;
}
.coursecard__card:not(:first-child) {
  padding-bottom: var(--bottom-card-height);
}
.coursecard__section {
  position: relative;
}
.coursecard__section:not(:first-child) {
  margin: 30px 0;
  position: absolute;
  visibility: hidden;
}
.coursecard__section--visible:not(:first-child) {
  position: relative;
  visibility: visible;
}
.coursecard__section:last-child {
  margin-bottom: 20px;
}
.coursecard__section textarea {
  resize: none;
  height: 60px;
  width: 100%;
  padding: 0.6rem 0.8rem;
  background-color: var(--bg-color);
  border-radius: 0.5rem;
  border: none;
  outline: none;
  margin-left: 5px;
  font-size: var(--medium-font-size);
  color: var(--black-color);
  font-family: var(--body-font);
}
.coursecard__section textarea::placeholder {
  font-family: var(--body-font);
  font-size: var(--medium-font-size);
  color: var(--gray-color-light);
}
.coursecard__rate {
  display: flex;
  justify-content: center;
  align-items: center;
}
.coursecard__rateCheck {
  display: inline-block;
  text-align: center;
  line-height: 40px;
  width: 45px;
  height: 45px;
  border-radius: 30px;
  background-color: var(--white-color);
  border: #758BFD 3px solid;
  color: #758BFD;
  font-weight: 500;
  margin-left: 10px;
  cursor: pointer;
}
.coursecard__rateCheck:last-child {
  margin-right: 10px;
}
.coursecard__rateCheck--checked {
  display: inline-block;
  text-align: center;
  line-height: 40px;
  width: 45px;
  height: 45px;
  border-radius: 30px;
  background-color: var(--second-color-light);
  color: var(--white-color);
  border: var(--second-color-light) 3px solid;
}
.coursecard__gradeExplanation {
  display: flex;
}
.coursecard__gradeExplanation div:first-child {
  width: 10%;
  margin: 0 20px;
}
.coursecard__gradeExplanation div:last-child {
  width: 90%;
}
.coursecard__bottom {
  position: absolute;
  display: flex;
  align-items: center;
  justify-content: space-between;
  width: 100%;
  padding: 30px 30px;
  height: var(--bottom-card-height);
  left: 0;
  bottom: calc(-height);
  background-color: var(--gray-color-light);
  border-end-end-radius: 5px;
  border-end-start-radius: 5px;
}
.coursecard__bottomStatesContainer {
  display: flex;
  align-items: center;
}
.coursecard__bottomState {
  position: absolute;
  visibility: hidden;
  display: flex;
  align-items: center;
}
.coursecard__bottomState--visible {
  position: relative;
  visibility: visible;
}
.coursecard__bottomStateCard {
  position: absolute;
  visibility: hidden;
  display: flex;
  height: 40px;
  padding: 0 10px;
  margin-left: 10px;
  align-items: center;
  background-color: var(--white-color);
  border-radius: 5px;
  color: var(--first-color);
}
.coursecard__bottomStateCard p {
  color: var(--first-color);
  font-weight: 500;
  margin-right: 5px;
}
.coursecard__bottomStateCard:last-child {
  color: var(--second-color);
}
.coursecard__bottomStateCard:last-child p {
  color: var(--second-color);
  font-weight: 500;
  margin-right: 5px;
}
.coursecard__bottomStateCard--visible {
  visibility: visible;
  position: relative;
}
.coursecard__bottomStateAlert {
  display: flex;
  align-items: center;
  position: absolute;
  visibility: hidden;
  color: var(--first-color);
}
.coursecard__bottomStateAlert--visible {
  position: relative;
  visibility: visible;
}
.coursecard__bottomBtnsContainer {
  display: flex;
  align-items: center;
}
.coursecard__bottomBtn {
  visibility: hidden;
  position: absolute;
}
.coursecard__bottomBtn--visible {
  visibility: visible;
  position: relative;
  margin-left: 15px;
}
.coursecard__studentQuestion {
  position: absolute;
  display: none;
}
.coursecard__studentQuestion--visible {
  position: relative;
  display: block;
}
.coursecard__studentQuestion h3 {
  margin-top: 30px;
  margin-bottom: 20px;
}
.coursecard__studentQuestionBox {
  position: relative;
  width: 100%;
  margin-bottom: 20px;
  border: solid 1px var(--gray-color-light);
  border-radius: 5px;
  padding: 20px;
}
.coursecard__studentQuestionBox--disabled {
  opacity: 0.5;
}
.coursecard__studentQuestionVisibility {
  position: absolute;
  right: 0px;
  top: 20px;
  display: flex;
  align-items: center;
  margin: 0 20px;
}
.coursecard__studentQuestionVisibility p {
  font-weight: 500;
  margin: 0;
  margin-right: 10px;
}
.coursecard__studentQuestionVisibility input {
  margin: 0;
}
.coursecard__studentQuestionType {
  margin: 0;
  margin-top: 15px;
  font-weight: 500;
  color: var(--gray-color-medium);
}
.coursecard__studentQuestionQuestion {
  margin: 0;
  margin-top: 6px;
}
.coursecard__studentQuestionInfo {
  display: flex;
  align-items: center;
  justify-content: start;
  color: var(--first-color);
}
.coursecard__studentQuestionInfo p {
  margin: 0;
  margin-left: 10px;
