.tabs{
    //position: relative;
    height: 100%;
    &__header{
        display: flex;
        align-items: center;
        justify-content: space-evenly;
        width: 100%;

        &Tab{
            position: relative;
            margin-top: 20px;
            margin-bottom: 10px;
            color: var(--gray-color-light);
            cursor: pointer;
            font-weight: 500;
            transition: 0.3s;

            &:hover{
                color: var(--second-color-lilac);
            }

            &::after{
                position: absolute;
                left: 0;
                bottom: -5px;
                content: "";
                width:0%;
                height: 3px;
                background-color: var(--second-color-lilac);
                border-radius: 5px;
            }

            &:hover::after{
                transition: 0.3s;
                width: 100%;
            }

            &--active{
                color: var(--second-color);

                &::after{
                    position: absolute;
                    left: 0;
                    bottom: -5px;
                    content: "";
                    width: 100%;
                    height: 3px;
                    background-color: var(--second-color);
                    border-radius: 10px;
                }
            }
        }


    }

    &__body{
        overflow-y: scroll;

        &Content{
            height: 100%;
            position: absolute;
            //padding-right: 40px;
            //padding-bottom: 40px;
            visibility: hidden;
            opacity: 0;
            transform: scale(0.98);
            transition: opacity 0.3s ease-in-out 0ms,
                transform 0.3s ease-in-out 0ms;

                &--active{
                    height: 100%;
                    //width: 100%;
                    visibility: visible;
                    opacity: 1;
                    transform: scale(1);
                }
        }
    }
}

